    "message": "Dear parents and carers\n\nWe are pleased to inform you that we have been working closely with the Department of Education to establish a quality early learning program that will cater to the needs of the Boggabri community in 2025 and beyond. \n\nResearch shows that effective early learning programs significantly enhance children’s long-term academic, social, and wellbeing outcomes once they enter school.\n\nThe Department of Education has had early discussions with an approved provider who is considering the establishment of a community-based preschool at our school site. \n\nAlthough no details or timeframes are available at this initial stage, we felt it was important to share this positive development with you and look forward to providing more details soon. \n\nIn the meantime, to help us better understand the community’s needs, we invite all interested families to complete a short survey to register your interest in attending a community preschool, including the ages of your children and the number of days you would be interested in.\n\nTo complete the survey simply scan the QR Code below or use the link below. \n\nhttps://forms.office.com/r/4ppNT3Q4wb",
